// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/// @title Decentralized Crowdfunding with Contributor Voting on Disbursements
/// @author
/// @notice Contributors fund a campaign. Manager creates spending requests that contributors vote on. Refunds allowed if target not met by deadline.
contract DecentralizedCrowdfund {
    // --- State ---
    address public manager;
    uint public target;             // funding goal in wei
    uint public deadline;           // unix timestamp after which refunds allowed if goal not met
    uint public raisedAmount;       // total contributed
    bool public goalReached;        // true once raisedAmount >= target

    uint public contributorsCount;  // number of unique contributors

    struct Request {
        string description;
        address payable recipient;
        uint value;                  // amount (wei) requested
        bool completed;              // whether funds were disbursed
        uint voteCount;              // number of contributor votes for this request
        mapping(address => bool) voters; // track who voted (per request)
    }

    // dynamic array of requests (we use storage mapping trick to have iterable indices)
    Request[] private requests;

    mapping(address => uint) public contributions;
    mapping(address => bool) public isContributor;

    // reentrancy guard
    uint private unlocked = 1;

    // --- Events ---
    event ContributionReceived(address indexed contributor, uint amount);
    event RefundIssued(address indexed contributor, uint amount);
    event RequestCreated(uint indexed requestId, string description, address recipient, uint value);
    event Voted(address indexed voter, uint indexed requestId);
    event RequestFinalized(uint indexed requestId, address recipient, uint value);
    event GoalReached(uint totalAmount);
    event DeadlinePassed(uint timestamp);

    // --- Modifiers ---
    modifier onlyManager() {
        require(msg.sender == manager, "Only manager");
        _;
    }

    modifier nonReentrant() {
        require(unlocked == 1, "Reentrant call");
        unlocked = 0;
        _;
        unlocked = 1;
    }

    modifier beforeDeadline() {
        require(block.timestamp < deadline, "Action allowed only before deadline");
        _;
    }

    modifier afterDeadline() {
        require(block.timestamp >= deadline, "Action allowed only after deadline");
        _;
    }

    // --- Constructor ---
    /// @param _target funding goal in wei
    /// @param _durationSeconds duration (seconds) from now until deadline
    constructor(uint _target, uint _durationSeconds) {
        require(_target > 0, "Target must be > 0");
        manager = msg.sender;
        target = _target;
        deadline = block.timestamp + _durationSeconds;
        goalReached = false;
    }

    // --- Public / External functions ---

    /// @notice Contribute ETH to the crowdfunding campaign
    function contribute() external payable beforeDeadline nonReentrant {
        require(msg.value > 0, "Must send ETH");

        // Add unique contributor
        if (!isContributor[msg.sender]) {
            isContributor[msg.sender] = true;
            contributorsCount += 1;
        }

        contributions[msg.sender] += msg.value;
        raisedAmount += msg.value;

        // Mark goal reached if meets or exceeds target
        if (!goalReached && raisedAmount >= target) {
            goalReached = true;
            emit GoalReached(raisedAmount);
        }

        emit ContributionReceived(msg.sender, msg.value);
    }

    /// @notice Manager creates a spending request. Recipient will receive funds if contributors approve.
    /// @param _description description of why funds are needed
    /// @param _recipient address to receive funds if request finalized
    /// @param _value amount in wei requested
    function createRequest(string calldata _description, address payable _recipient, uint _value) external onlyManager {
        require(_recipient != address(0), "Invalid recipient");
        require(bytes(_description).length > 0, "Description required");
        require(_value > 0, "Value > 0 required");

        // create new Request in storage with mapping initialization
        Request storage newRequest = requests.push();
        newRequest.description = _description;
        newRequest.recipient = _recipient;
        newRequest.value = _value;
        newRequest.completed = false;
        newRequest.voteCount = 0;

        uint reqId = requests.length - 1;
        emit RequestCreated(reqId, _description, _recipient, _value);
    }

    /// @notice Contributors vote for a request. Each contributor may vote once per request.
    /// @param requestId index of the request
    function voteRequest(uint requestId) external {
        require(requestId < requests.length, "Invalid request id");
        require(isContributor[msg.sender], "Only contributors can vote");

        Request storage req = requests[requestId];
        require(!req.completed, "Request already completed");
        require(!req.voters[msg.sender], "Already voted for this request");

        req.voters[msg.sender] = true;
        req.voteCount += 1;

        emit Voted(msg.sender, requestId);
    }

    /// @notice Finalize a request and send funds to recipient if majority voters approve and sufficient balance exists.
    /// @param requestId index of the request
    function finalizeRequest(uint requestId) external onlyManager nonReentrant {
        require(requestId < requests.length, "Invalid request id");
        Request storage req = requests[requestId];

        require(!req.completed, "Already completed");
        require(goalReached, "Funding goal not reached; cannot disburse");
        require(req.value <= address(this).balance, "Insufficient contract balance");

        // majority requirement: strictly greater than half of UNIQUE contributors
        // If contributorsCount == 0, cannot finalize
        require(contributorsCount > 0, "No contributors present");
        require(req.voteCount * 2 > contributorsCount, "Not enough votes (majority required)");

        req.completed = true;

        // Effects done, now interaction
        (bool sent, ) = req.recipient.call{value: req.value}("");
        require(sent, "Transfer failed");

        emit RequestFinalized(requestId, req.recipient, req.value);
    }

    /// @notice Refund contributed ETH if deadline passed and target not reached. Contributor withdraws their own contribution.
    function refund() external nonReentrant afterDeadline {
        require(!goalReached, "Goal reached; refunds not available");
        uint contributed = contributions[msg.sender];
        require(contributed > 0, "No contributions to refund");

        // Zero out before transfer to prevent reentrancy issues
        contributions[msg.sender] = 0;
        isContributor[msg.sender] = false;
        // Note: contributorsCount is left as-is to keep majority semantics consistent for already active requests;
        // alternatively, you may decrement contributorsCount, but this could complicate majority math across multiple refunds.
        // We will decrement to reflect current contributor base:
        if (contributorsCount > 0) {
            contributorsCount -= 1;
        }

        (bool sent, ) = payable(msg.sender).call{value: contributed}("");
        require(sent, "Refund transfer failed");

        raisedAmount -= contributed;
        emit RefundIssued(msg.sender, contributed);
    }

    // --- View helpers ---

    /// @notice Returns number of requests
    function getRequestsCount() external view returns (uint) {
        return requests.length;
    }

    /// @notice Get summary info about the campaign
    function getSummary() external view returns (
        address _manager,
        uint _target,
        uint _deadline,
        uint _raisedAmount,
        uint _contributorsCount,
        bool _goalReached,
        uint _requestsCount,
        uint _contractBalance
    ) {
        _manager = manager;
        _target = target;
        _deadline = deadline;
        _raisedAmount = raisedAmount;
        _contributorsCount = contributorsCount;
        _goalReached = goalReached;
        _requestsCount = requests.length;
        _contractBalance = address(this).balance;
    }

    /// @notice Utility to view certain fields of a request (mappings are not directly returnable)
    function getRequest(uint requestId) external view returns (
        string memory description,
        address recipient,
        uint value,
        bool completed,
        uint voteCount
    ) {
        require(requestId < requests.length, "Invalid request id");
        Request storage req = requests[requestId];
        description = req.description;
        recipient = req.recipient;
        value = req.value;
        completed = req.completed;
        voteCount = req.voteCount;
    }

    /// @notice Check whether an address voted on a given request
    function hasVoted(uint requestId, address voter) external view returns (bool) {
        require(requestId < requests.length, "Invalid request id");
        return requests[requestId].voters[voter];
    }

    /// @notice Get contribution amount for an address
    function getContributionOf(address contributor) external view returns (uint) {
        return contributions[contributor];
    }

    // --- Fallback receive ---
    receive() external payable {
        // Accept direct ETH but treat it as contribution
        // NOTE: calling contribute() would enforce beforeDeadline modifier; here we mimic contribution semantics.
        require(block.timestamp < deadline, "Deadline passed; cannot accept direct contributions");
        if (!isContributor[msg.sender]) {
            isContributor[msg.sender] = true;
            contributorsCount += 1;
        }
        contributions[msg.sender] += msg.value;
        raisedAmount += msg.value;

        if (!goalReached && raisedAmount >= target) {
            goalReached = true;
            emit GoalReached(raisedAmount);
        }
        emit ContributionReceived(msg.sender, msg.value);
    }

    fallback() external payable {
        // forward to receive
        if (msg.value > 0) {
            // route to receive
            // NOTE: EVM will call receive automatically for empty calldata; fallback for non-empty calldata won't here,
            // so we explicitly handle by requiring no calldata for simplicity.
        }
    }
}

